description:
Do you remember your first love? Remember how as soon as things got serious you could imagine spending the rest of your life with that first love? Well Eva Sedona has had that feeling from the first time she had ever met Celeste. Celeste is an experienced woman, and Eva is not aware of what she's getting herself into. Eva secretly vows to do anything she can to keep Celeste in her grasp, but when Celeste calls her to drop everything she's doing and come over, Eva flies to the finish. Eva's nerves read perfectly when she professes her love to Celeste before hanging up...

